import React, { useRef, useEffect } from 'react'
import * as d3 from 'd3'


function StuckColumnChart() {

    const ref = useRef(null)
    useEffect(() => {
        new CovidContinent(ref.current)
    }, [])

    return (
        <section id="map">
            <p style={{paddingBottom:"20px", textAlign:"center", fontWeight:"550", fontSize: "20px"}}>
                Stuck Column Chart of Continents(Confirmed Cases)</p>
            <div ref={ref}>            </div>
        </section>
    )
}

class CovidContinent{
    constructor(div) {
        this.div = div;
        this.handleData();

    }

}

export default StuckColumnChart
